import React, { useState } from 'react';
import { addDiaryEntry } from '../../api/diary';
import Input from '../common/Input';
import Button from '../common/Button';

const DiaryForm = () => {
  const [symptoms, setSymptoms] = useState('');
  const [medications, setMedications] = useState('');

  const handleSubmit = async () => {
    await addDiaryEntry({ symptoms, medications, date: new Date().toISOString() });
    setSymptoms('');
    setMedications('');
  };

  return (
    <div>
      <Input value={symptoms} onChange={(e) => setSymptoms(e.target.value)} placeholder="Symptômes" />
      <Input value={medications} onChange={(e) => setMedications(e.target.value)} placeholder="Médicaments" />
      <Button onClick={handleSubmit}>Enregistrer</Button>
    </div>
  );
};
export default DiaryForm;
